import React from 'react';
import CardMovie from './CardMovie';
import { Row } from 'react-bootstrap';

function MoviesList({ movies }) {
  return (
    <Row>
      {movies.length >= 1 ? (
        movies.map((movie) => {
          return (
            <div key={movie.id}>
              <CardMovie />
            </div>
          );
        })
      ) : null}
    </Row>
  );
}

export default MoviesList;
